import React from 'react';
import "../pwetty/PAGEPAGE.css"

import project1 from "../assets/"

const FruitSection = ({ heading, subheading, fruits }) => {
  return (
    <section className="fruit-section">
      <h1>{heading}</h1>
      <p>{subheading}</p>
      <div className="fruit-container">
        {fruits.map((fruit, index) => (
          <div className="fruit-item" key={index}>
            <img src={fruit.image} alt={fruit.name} />
            <h2 className="fruit-caption">{fruit.caption}</h2>
          </div>
        ))}
      </div>
      <div className="button-group">
        <button className="primary-btn">Button</button>
        <button className="secondary-btn">Secondary button</button>
      </div>
    </section>
  );
};

const PAGEPAGE = () => {
  const sections = [
    {
      heading: "Heading",
      subheading: "A subheading for this section, as long or as short as you like",
      fruits: [
        { image: "fruit1.jpg", name: "Fruit 1", caption: "Caption for Fruit 1" },
        { image: "fruit2.jpg", name: "Fruit 2", caption: "Caption for Fruit 2" }
      ]
    },
    {
      heading: "Heading",
      subheading: "A subheading for this section, as long or as short as you like",
      fruits: [
        { image: "fruit3.jpg", name: "Fruit 3", caption: "Caption for Fruit 3" },
        { image: "fruit4.jpg", name: "Fruit 4", caption: "Caption for Fruit 4" }
      ]
    }
  ];

  return (
    <div className="app">
      {sections.map((section, index) => (
        <FruitSection
          key={index}
          heading={section.heading}
          subheading={section.subheading}
          fruits={section.fruits}
        />
      ))}
    </div>
  );
};

export default PAGEPAGE;
